        receivers = [random.sample(range(n), n) for _ in range(n)]
        prob = {'proposer_prefs': proposers, 'receiver_prefs': receivers}
        sol = mod.solve(prob)
        ok = validate(prob, sol)
        if not ok:
            print('FAIL', n, prob, sol)
            sys.exit(1)
print('All tests passed')
